let data = fruitData.concat(elecData).concat(vegetData)
let renderData = (data) => {
  let dom = document.getElementById("list-product");
  dom.innerHTML = "";
  
  for (let i = 0; i < data.length; i++) {
    let html = `        <div class="card" style="width: 18rem;">
        <img src="${data[i].img}" class="card-img-top" alt="...">
        <div class="card-body">
          <h5 class="card-title">${data[i].name}</h5>
          <p class="card-text">${data[i].des}</p>
          <h6 id="price">$${data[i].price}</h6>
          <a href="#" class="btn btn-danger">Buy</a>
        </div>
      </div>`;
      dom.innerHTML += html

  }

}



  


  
renderData(data)

let dom_fruit = document.getElementById("fr")
dom_fruit.addEventListener("click",()=>{
    renderData(fruitData);
})
let dom_elec = document.getElementById("el")
dom_elec.addEventListener("click",()=>{
    renderData(elecData);
})
let dom_veget = document.getElementById("ve")
dom_veget.addEventListener("click",()=>{
  renderData(vegetData);
})
let dom_search = document.getElementById("search")
dom_search.addEventListener("submit", (e)=>{
    e.preventDefault();
    let key = dom_search.search.value.toLowerCase()
    let result = data.filter((d)=>{
        return (d.name.toLowerCase()).includes(key)
    })

    renderData(result)
})

document.getElementById("bn").addEventListener("click", ()=>{
  let coloneData = [...data]
  coloneData.map(e=>e.price = e.price*0.8)
    renderData(coloneData)
})


